import Log from './componentsel/Log';
import Logcr from './componentsel/Logcr';
import './Login.css';

export default class Login extends React.Component {
  state = {
    login: [
      { email: 'chaxalyan.v@mail.ru', password: 'sadadfsa' },
      { email: 'amiryan.@mail.ru', password: 'sadadfsa' },
    ],
  };

  render() {
    const { login } = this.state;
    return (
      <div className='login'>
        <Log />
      </div>
    );
  }
}
